import{_ as a,e as t,f as i,V as e}from"./chunks/framework.723ed59e.js";const l=JSON.parse('{"title":"【地图性能占用高】前后台帧率设置","titleTemplate":":title | 空荧酒馆","description":"在设置中可以调整【前台帧率】、【后台帧率】，以降低性能，降低对游戏帧率的影响。","frontmatter":{"aside":false,"titleTemplate":":title | 空荧酒馆","prev":{"text":"【自动追踪】问题排查","link":"../auto-tracking/troubleshoot"},"next":{"text":"【批量选择】使用说明","link":"../batch-selection/instructions"},"description":"在设置中可以调整【前台帧率】、【后台帧率】，以降低性能，降低对游戏帧率的影响。"},"headers":[],"relativePath":"manual/guide/bg/bgfrate.md","filePath":"manual/guide/bg/bgfrate.md","lastUpdated":1688793442000}'),r={name:"manual/guide/bg/bgfrate.md"},n=[e('<h1 id="【地图性能占用高】前后台帧率设置" tabindex="-1">【地图性能占用高】前后台帧率设置 <a class="header-anchor" href="#【地图性能占用高】前后台帧率设置" aria-label="Permalink to &quot;【地图性能占用高】前后台帧率设置&quot;">​</a></h1><h2 id="frt" tabindex="-1">帧率 <a class="header-anchor" href="#frt" aria-label="Permalink to &quot;帧率 {#frt}&quot;">​</a></h2><p>在设置中可以调整【前台帧率】、【后台帧率】，以降低性能，降低对游戏帧率的影响。推荐前台帧率 30-50 帧，后台帧率 1-10 帧。</p><p>若希望使用【窗口置顶】功能，该功能将使客户端处于后台（非当前操作窗口）时，仍置顶显示。推荐设置后台帧率与前台帧率一致。</p><figure><img src="/docs/imgs/manual/bg-frate/1.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>若将帧率拉至最左，将提示【垂直同步】，垂直同步功能实际为【与显示器帧率同步】，例如显示器是 144 帧，则拉至【垂直同步】，地图帧率也将设置为 144 帧</p><figure><img src="/docs/imgs/manual/bg-frate/2.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure></div><h2 id="int" tabindex="-1">追踪间隔 <a class="header-anchor" href="#int" aria-label="Permalink to &quot;追踪间隔 {#int}&quot;">​</a></h2><p>自动追踪设置中，【追踪间隔】设置的单位是秒。</p><ul><li>若调低追踪间隔（最大间隔 1 秒），则 CPU 性能占用提高；</li><li>若调高追踪间隔（最小间隔 1 秒），则 CPU 性能占用降低，同时追踪坐标显示会略有延迟。</li></ul><figure><img src="/docs/imgs/manual/bg-frate/3.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure>',10)];const o=a(r,[["render",function(a,e,l,r,o,s){return t(),i("div",null,n)}]]);export{l as __pageData,o as default};
